n    cur_frm.set_df_property(\"myfield\", \"read_only\", doc.__islocal ? 0 : 1);\n}\n\n// addtional permission checking\ncur_frm.cscript.custom_validate = function(doc) {\n    if(user==\"user1@example.com\" && doc.purpose!=\"Material Receipt\") {\n        msgprint(\"You are only allowed Material Receipt\");\n        validated = false;\n    }\n}\n\n// calculate sales incentive\ncur_frm.cscript.custom_validate = function(doc) {\n    // calculate incentives for each person on the deal\n    total_incentive = 0\n    $.each(doc.sales_team), function(i, d) {\n\n        // calculate incentive\n        var incentive_percent = 2;\n        if(doc.base_grand_total &gt; 400) incentive_percent = 4;\n\n        // actual incentive\n        d.incentives = flt(doc.base_grand_total) * incentive_percent / 100;\n        total_incentive += flt(d.incentives)\n    });\n\n    doc.total_incentive = total_incentive;\n}\n</code>\n</pre>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('59284bd61f','2013-06-19 15:57:32.000000','2015-07-28 14:29:41.550730','Administrator','Administrator',0,'Shopping Cart Settings','fields','DocType',7,'quotation_series','Quotation Series',NULL,'Select',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('592bcb89fe','2013-02-22 01:27:51.000000','2015-07-28 14:27:17.175125','Administrator','Administrator',0,'Opportunity Item','fields','DocType',11,'image','Image',NULL,'Attach',NULL,'',NULL,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),('59305249b6','2015-02-18 00:59:34.560476','2015-07-28 14:29:42.716036','Administrator','Administrator',0,'Hub Settings','fields','DocType',9,'seller_country','Seller Country',NULL,'Link',NULL,'Country',0,0,0,0,0,0,NULL,0,0,NULL,NULL,0,0,NULL,NULL,NULL,NULL,0,0,NULL,0,''),('5935cdfcc7','2013-05-24 12:15:51.000000','2015-07-28 14:27:11.235903','Administrator','Ad