INSERT INTO `tabPrint Format` VALUES ('Cheque Printing Format','2012-04-11 13:16:56.000000','2015-05-29 01:57:51.203850','Administrator','Administrator',0,NULL,NULL,NULL,1,'Journal Entry',NULL,'Yes',NULL,'<div style=\"position: relative\">\n\n	{%- from \"templates/print_formats/standard_macros.html\" import add_header -%}\n<div class=\"page-break\">\n    {%- if not doc.get(\"print_heading\") and not doc.get(\"select_print_heading\") \n        and doc.set(\"select_print_heading\", _(\"Payment Advice\")) -%}{%- endif -%}\n    {{ add_header(0, 1, doc, letter_head, no_letterhead) }}\n\n{%- for label, value in (\n        (_(\"Voucher Date\"), frappe.utils.formatdate(doc.voucher_date)),\n        (_(\"Reference / Cheque No.\"), doc.cheque_no),\n        (_(\"Reference / Cheque Date\"), frappe.utils.formatdate(doc.cheque_date))\n    ) -%}\n    <div class=\"row\">\n        <div class=\"col-xs-4\"><label class=\"text-right\">{{ label }}</label></div>\n        <div class=\"col-xs-8\">{{ value }}</div>\n    </div>\n{%- endfor -%}\n	<hr>\n	<p>{{ _(\"This amount is in full / part settlement of the listed bills\") }}:</p>\n{%- for label, value in (\n         (_(\"Amount\"), \"<strong>\" + doc.get_formatted(\"total_amount\") + \"</strong><br>\" + (doc.total_amount_in_words or \"\") + \"<br>\"),\n        (_(\"References\"), doc.remark)\n    ) -%}\n    <div class=\"row\">\n        <div class=\"col-xs-4\"><label class=\"text-right\">{{ label }}</label></div>\n        <div class=\"col-xs-8\">{{ value }}</div>\n    </div>\n    {%- endfor -%}\n    <hr>\n	<div style=\"position: absolute; top: 14cm; left: 0cm;\">\n		Prepared By</div>\n	<div style=\"position: absolute; top: 14cm; left: 5.5cm;\">\n		Authorised Signatory</div>\n	<div style=\"position: absolute; top: 14cm; left: 11cm;\">\n		Received Payment as Above</div>\n	<div style=\"position: absolute; top: 16.4cm; left: 5.9cm;\">\n		<strong>_____________</strong></div>\n	<div style=\"position: absolute; top: 16.7cm; left: 6cm;\">\n		<strong>A/C Payee</strong></div>\n	<div style=\"position: absolute; top: 16.7cm; left: 5.9cm;\">\n		<strong>_____________</strong></div>\n	<div style=\"position: absolute; top: 16.9cm; left: 12cm;\">\n		{{ frappe.utils.formatdate(doc.cheque_date) }}</div>\n	<div style=\"position: absolute; top: 17.9cm; left: 1cm;\">\n		{{ doc.pay_to_recd_from }}</div>\n	<div style=\"position: absolute; top: 18.6cm; left: 1cm; width: 7cm;\">\n		{{ doc.total_amount_in_words }}</div>\n	<div style=\"position: absolute; top: 19.7cm; left: 12cm;\">\n		{{ doc.get_formatted(\"total_amount\") }}</div>\n</div>',1,NULL,'Server',NULL),('Credit Note','2014-08-28 11:11:39.796473','2015-07-22 17:42:01.560817','Administrator','Administrator',0,'Journal Entry','__print_formats','DocType',2,'Journal Entry',NULL,'Yes',0,'{%- from \"templates/print_formats/standard_macros.html\" import add_header -%}\n\n<div class=\"page-break\">\n    {%- if not doc.get(\"print_heading\") and not doc.get(\"select_print_heading\") \n        and doc.set(\"select_print_heading\", _(\"Credit Note\")) -%}{%- endif -%}\n    {{ add_header(0, 1, doc, letter_head, no_letterhead) }}\n\n    {%- for label, value in (\n        (_(\"Credit To\"), doc.pay_to_recd_from),\n        (_(\"Date\"), frappe.utils.formatdate(doc.voucher_date)),\n        (_(\"Amount\"), \"<strong>\" + doc.get_formatted(\"total_amount\") + \"</strong><br>\" + (doc.total_amount_in_words or \"\") + \"<br>\"),\n        (_(\"Remarks\"), doc.remark)\n    ) -%}\n\n    <div class=\"row\">\n        <div class=\"col-xs-3\"><label class=\"text-right\">{{ label }}</label></div>\n        <div class=\"col-xs-9\">{{ value }}</div>\n    </div>\n\n    {%- endfor -%}\n\n    <hr>\n    <br>\n    <p class=\"strong\">\n        {{ _(\"For\") }} {{ doc.company }},<br>\n        <br>\n        <br>\n        <br>\n        {{ _(\"Authorized Signatory\") }}\n    </p>\n</div>\n\n\n',0,NULL,'Server',NULL),('Credit Note - Negative Invoice','2015-07-22 17:45:22.220567','2015-07-22 17:45:22.220567','Administrator','Administrator',0,NULL,NULL,NULL,NULL,'Sales Invoice',0,'Yes',0,'<style>\n	.print-format table, .print-format tr, \n	.print-format td, .print-format div, .print-format p {\n		font-family: Monospace;\n		line-height: 200%;\n		vertical-align: middle;\n	}\n	@media screen {\n		.print-format {\n			width: 4in;\n			padding: 0.25in;\n			min-height: 6in;\n		}\n	}\n</style>\n\n<p class=\"text-center\">\n	{{ doc.company }}<br>\n	{{ doc.select_print_heading or _(\"Credit Note\") }}<br>\n</p>\n\n<hr>\n\n{%- for label, value in (\n    (_(\"Receipt No\"), doc.name),\n    (_(\"Date\"), doc.get_formatted(\"posting_date\")),\n	(_(\"Customer\"), doc.customer_name),\n    (_(\"Amount\"), \"<strong>\" + doc.get_formatted(\"grand_total\", absolute_value=True) + \"</strong><br>\" + (doc.in_words or \"\")),\n	(_(\"Against\"), doc.return_against),\n    (_(\"Remarks\"), doc.remarks)\n) -%}\n\n		<div class=\"row\">\n		    <div class=\"col-xs-4\"><label class=\"text-right\">{{ label }}</label></div>\n		    <div class=\"col-xs-8\">{{ value }}</div>\n		</div>\n{%- endfor -%}\n\n<hr>\n<br>\n<p class=\"strong\">\n    {{ _(\"For\") }} {{ doc.company }},<br>\n    <br>\n    <br>\n    <br>\n        {{ _(\"Authorized Signatory\") }}\n</p>',1,'Default','Server',NULL),('Offer Letter','2015-03-05 14:34:26.751210','2015-04-01 05:22:51.345050','Administrator','Administrator',0,NULL,NULL,NULL,NULL,'Offer Letter',0,'Yes',0,'{% if letter_head and not no_letterhead -%}\n    <div class=\"letter-head\">{{ letter_head }}</div>\n    <hr>\n{%- endif %}\n\n<div class=\"page-break\">\n<p>\n\n<!-- offer letter content starts here, <br> is used to create new lines -->\nDate: {{ doc.offer_date }}\n<br><br>\n\nDear {{ doc.applicant_name }}, \n\n<br><br>\n\nWe are pleased to appoint you in the services of {{ doc.company }} on the terms and conditions detailed in this letter.\n\n<br><br>\n\nYour designation shall be <b>{{ doc.designation }}</b>.\n\n<br><br>\n\n<!-- offer letter terms and description from the table -->\n\n{%- if doc.offer_terms -%}\n    {%- for row in doc.offer_terms -%}\n        <b>{{ row.offer_term }}:</b> {{ row.value }}\n\n        <br>\n    {%- endfor -%}\n{%- endif -%}\n\n<br>\n\n<!-- offer letter content continues -->\n\n\nPlease read the detailed terms as below. If you have any queries, feel free to get in touch with us.\nWe look forward to your long and fruitful career association with our organisation.\nIf you decide to join us, \'Welcome to {{ doc.company }} !\'\n\n<br><br>\n\n<p class=\"strong\">\n\nYours truly,\n\n<br><br><br><br>\n\nAuthorized Signatory\n\n<br>\n\n{{ doc.company }}\n\n<!-- offer letter content ends here -->\n\n</p>\n</div>\n\n<!-- offer letter terms and conditions -->\n<div> {{ doc.terms }} </div>',1,NULL,'Server',NULL),('Payment Receipt Voucher','2012-05-01 12:46:31.000000','2015-01-16 11:03:22.893209','Administrator','Administrator',0,NULL,NULL,NULL,1,'Journal Entry',NULL,'Yes',NULL,'{%- from \"templates/print_formats/standard_macros.html\" import add_header -%}\n<div class=\"page-break\">\n    {%- if not doc.get(\"print_heading\") and not doc.get(\"select_print_heading\") \n        and doc.set(\"select_print_heading\", _(\"Payment Receipt Note\")) -%}{%- endif -%}\n    {{ add_header(0, 1, doc, letter_head, no_letterhead) }}\n\n    {%- for label, value in (\n        (_(\"Received On\"), frappe.utils.formatdate(doc.voucher_date)),\n        (_(\"Received From\"), doc.pay_to_recd_from),\n        (_(\"Amount\"), \"<strong>\" + doc.get_formatted(\"total_amount\") + \"</strong><br>\" + (doc.total_amount_in_words or \"\") + \"<br>\"),\n        (_(\"Remarks\"), doc.remark)\n    ) -%}\n    <div class=\"row\">\n        <div class=\"col-xs-3\"><label class=\"text-right\">{{ label }}</label></div>\n        <div class=\"col-xs-9\">{{ value }}</div>\n    </div>\n\n    {%- endfor -%}\n\n    <hr>\n    <br>\n    <p class=\"strong\">\n        {{ _(\"For\") }} {{ doc.company }},<br>\n        <br>\n        <br>\n        <br>\n        {{ _(\"Authorized Signatory\") }}\n    </p>\n</div>\n\n',NULL,NULL,'Server',NULL),('POS Invoice','2011-12-21 11:08:55.000000','2015-04-21 05:06:29.380856','Administrator','Administrator',0,NULL,NULL,NULL,1,'Sales Invoice',NULL,'Yes',NULL,'<style>\n	.print-format table, .print-format tr, \n	.print-format td, .print-format div, .print-format p {\n		font-family: Monospace;\n		line-height: 200%;\n		vertical-align: middle;\n	}\n	@media screen {\n		.print-format {\n			width: 4in;\n			padding: 0.25in;\n			min-height: 8in;\n		}\n	}\n</style>\n\n<p class=\"text-center\">\n	{{ doc.company }}<br>\n	{{ doc.select_print_heading or _(\"Invoice\") }}<br>\n</p>\n<p>\n	<b>{{ _(\"Receipt No\") }}:</b> {{ doc.name }}<br>\n	<b>{{ _(\"Date\") }}:</b> {{ doc.get_formatted(\"posting_date\") }}<br>\n	<b>{{ _(\"Customer\") }}:</b> {{ doc.customer_name }}\n</p>\n\n<hr>\n<table class=\"table table-condensed cart no-border\">\n	<thead>\n		<tr>\n			<th width=\"50%\">{{ _(\"Item\") }}</b></th>\n			<th width=\"25%\" class=\"text-right\">{{ _(\"Qty\") }}</th>\n			<th width=\"25%\" class=\"text-right\">{{ _(\"Amount\") }}</th>\n		</tr>\n	</thead>\n	<tbody>\n		{%- for item in doc.items -%}\n		<tr>\n			<td>\n				{{ item.item_code }}\n				{%- if item.item_name != item.item_code -%}\n					<br>{{ item.item_name }}{%- endif -%}\n			</td>\n			<td class=\"text-right\">{{ item.qty }}<br>@ {{ item.get_formatted(\"rate\") }}</td>\n			<td class=\"text-right\">{{ item.get_formatted(\"amount\") }}</td>\n		</tr>\n		{%- endfor -%}\n	</tbody>\n</table>\n<table class=\"table table-condensed no-border\">\n	<tbody>\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ _(\"Net Total\") }}\n			</td>\n			<td class=\"text-right\">\n				{{ doc.get_formatted(\"net_total\") }}\n			</td>\n		</tr>\n		{%- for row in doc.taxes -%}\n		{%- if not row.included_in_print_rate -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ row.description }}\n			</td>\n			<td class=\"text-right\">\n				{{ row.get_formatted(\"tax_amount\", doc) }}\n			</td>\n		</tr>\n		{%- endif -%}\n		{%- endfor -%}\n		{%- if doc.discount_amount -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 75%\">\n				{{ _(\"Discount\") }}\n			</td>\n			<td class=\"text-right\">\n				{{ doc.get_formatted(\"discount_amount\") }}\n			</td>\n		</tr>\n		{%- endif -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 75%\">\n				<b>{{ _(\"Grand Total\") }}</b>\n			</td>\n			<td class=\"text-right\">\n				{{ doc.get_formatted(\"grand_total\") }}\n			</td>\n		</tr>\n	</tbody>\n</table>\n{% if doc.get(\"taxes\", filters={\"included_in_print_rate\": 1}) %}\n<hr>\n<p><b>Taxes Included:</b></p>\n<table class=\"table table-condensed no-border\">\n	<tbody>\n		{%- for row in doc.taxes -%}\n		{%- if row.included_in_print_rate -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ row.description }}\n			</td>\n			<td class=\"text-right\">\n				{{ row.get_formatted(\"tax_amount_after_discount_amount\", doc) }}\n			</td>\n		<tr>\n		{%- endif -%}\n		{%- endfor -%}\n	</tbody>\n</table>\n{%- endif -%}\n<hr>\n<p>{{ doc.terms or \"\" }}</p>\n<p class=\"text-center\">{{ _(\"Thank you, please visit again.\") }}</p>',1,NULL,'Server',NULL);
