INSERT INTO `tabUser` VALUES ('Administrator','2015-07-28 14:26:35.221653','2015-07-28 14:37:06.857096','Administrator','Administrator',0,NULL,NULL,NULL,NULL,'https://secure.gravatar.com/avatar/7b7bc2512ee1fedcd76bdc68926d4f7b?d=retro',NULL,NULL,'System User',NULL,NULL,'{\"frappe\": {\"version\": \"5.1.4\", \"description\": \"## Frappe Framework\\n\\nFrappe is a full stack web application framework written in Python,\\nJavascript, HTML/CSS with MySQL as the backend. It was built for ERPNext\\nbut is pretty generic and can be used to build database driven apps.\\n\\nThe key differece in Frappe compared to other frameworks is that Frappe\\nis that meta-data is also treated as data and is used to build front-ends\\nvery easily. Frappe comes with a full blown admin UI called the **Desk**\\nthat handles forms, navigation, lists, menus, permissions, file attachment\\nand much more out of the box.\\n\\nFrappe also has a plug-in architecture that can be used to build plugins\\nto ERPNext.\\n\\n### Links:\\n\\n- Project Home: [https://frappe.io](https://frappe.io)\\n- Tutorial: [https://frappe.io/tutorial](https://frappe.io/tutorial)\\n- GitHub: [https://github.com/frappe/frappe](https://github.com/frappe/frappe)\\n- Forum: [https://discuss.erpnext.com](https://discuss.erpnext.com)\\n\", \"title\": \"Frappe Framework\"}, \"erpnext\": {\"version\": \"5.3.1\", \"description\": \"## ERPNext\\n\\nERPNext is a fully featured ERP system designed for Small and Medium Sized\\nbusiness. ERPNext covers a wide range of features including Accounting, CRM,\\nInventory management, Selling, Purchasing, Manufacturing, Projects, HR &\\nPayroll, Website, E-Commerce and much more.\\n\\nERPNext is based on the Frappe Framework is highly customizable and extendable.\\nYou can create Custom Form, Fields, Scripts and can also create your own Apps\\nto extend ERPNext functionality.\\n\\nERPNext is Open Source under the GNU General Public Licence v3 and has been\\nlisted as one of the Best Open Source Softwares in the world by my online\\nblogs.\\n\\n### Links\\n\\n- Website: [https://erpnext.com](https://erpnext.com)\\n- GitHub: [https://github.com/frappe/erpnext](https://github.com/frappe/erpnext)\\n- Forum: [https://discuss.erpnext.com](https://discuss.erpnext.com)\\n- Frappe Framework: [https://frappe.io](https://frappe.io)\\n\\n\", \"title\": \"ERPNext\"}}',1,'Administrator',NULL,'','2015-08-10 19:56:36.236230',NULL,NULL,NULL,'admin@example.com',NULL,NULL,'202.12.83.44',NULL,'Fill Screen',1,NULL,0,NULL,NULL,NULL,'',1,NULL,NULL,NULL,0),('dngupta78@gmail.com','2015-07-28 14:37:03.281096','2015-07-28 14:37:03.789000','Administrator','Administrator',0,NULL,NULL,NULL,NULL,'https://secure.gravatar.com/avatar/d421c3e9d30cae34701fcf5d8fa93650?d=retro','Gupta',NULL,'System User',NULL,NULL,'{\"frappe\": {\"version\": \"5.1.4\", \"description\": \"## Frappe Framework\\n\\nFrappe is a full stack web application framework written in Python,\\nJavascript, HTML/CSS with MySQL as the backend. It was built for ERPNext\\nbut is pretty generic and can be used to build database driven apps.\\n\\nThe key differece in Frappe compared to other frameworks is that Frappe\\nis that meta-data is also treated as data and is used to build front-ends\\nvery easily. Frappe comes with a full blown admin UI called the **Desk**\\nthat handles forms, navigation, lists, menus, permissions, file attachment\\nand much more out of the box.\\n\\nFrappe also has a plug-in architecture that can be used to build plugins\\nto ERPNext.\\n\\n### Links:\\n\\n- Project Home: [https://frappe.io](https://frappe.io)\\n- Tutorial: [https://frappe.io/tutorial](https://frappe.io/tutorial)\\n- GitHub: [https://github.com/frappe/frappe](https://github.com/frappe/frappe)\\n- Forum: [https://discuss.erpnext.com](https://discuss.erpnext.com)\\n\", \"title\": \"Frappe Framework\"}, \"erpnext\": {\"version\": \"5.3.1\", \"description\": \"## ERPNext\\n\\nERPNext is a fully featured ERP system designed for Small and Medium Sized\\nbusiness. ERPNext covers a wide range of features including Accounting, CRM,\\nInventory management, Selling, Purchasing, Manufacturing, Projects, HR &\\nPayroll, Website, E-Commerce and much more.\\n\\nERPNext is based on the Frappe Framework is highly customizable and extendable.\\nYou can create Custom Form, Fields, Scripts and can also create your own Apps\\nto extend ERPNext functionality.\\n\\nERPNext is Open Source under the GNU General Public Licence v3 and has been\\nlisted as one of the Best Open Source Softwares in the world by my online\\nblogs.\\n\\n### Links\\n\\n- Website: [https://erpnext.com](https://erpnext.com)\\n- GitHub: [https://github.com/frappe/erpnext](https://github.com/frappe/erpnext)\\n- Forum: [https://discuss.erpnext.com](https://discuss.erpnext.com)\\n- Frappe Framework: [https://frappe.io](https://frappe.io)\\n\\n\", \"title\": \"ERPNext\"}}',1,'Deep Narayan',NULL,'','2015-07-28 14:37:19.135987',NULL,NULL,NULL,'dngupta78@gmail.com',NULL,NULL,'117.192.59.84',NULL,'Fill Screen',1,NULL,0,NULL,NULL,NULL,'',1,NULL,NULL,NULL,0),('Guest','2015-07-28 14:26:35.304109','2015-07-28 14:26:35.304109','Administrator','Administrator',0,NULL,NULL,NULL,NULL,'https://secure.gravatar.com/avatar/adb831a7fdd83dd1e2a309ce7591dff8?d=retro',NULL,NULL,'System User',NULL,NULL,NULL,1,'Guest',NULL,'',NULL,NULL,NULL,NULL,'guest@example.com',NULL,NULL,NULL,NULL,'Fill Screen',1,NULL,0,NULL,NULL,NULL,'',1,NULL,NULL,NULL,0);
